    "2016-07-16T01:34:51.503294",nt"name": "fire-management-unit-polygon",nt"isopen":
    false,nt"url": null,nt"notes": "Fire Management Units(FMUs) for BLM administered
    Lands in Idaho. An FMU is a management area definable by objectives, management
    constraints, topographic features, access, values to be protected, political boundaries,
    fuel types, and fire regime groups; that set it apart from the management characteristics
    of an adjacent FMU. FMUs are relativelty ranked within each Fire Planning Unit (FPU)
    for management objectives and priorities for fire suppression, emergency stabilization
    and rehabilitation, fuels treatment, community assistance, and wildfire use for
    resource benefit (WFU). There were 5 BLM FPUs for the 2005 fire planning: North
    Idaho, Central Idaho, Eastern Idaho, SouthCentral Idaho, and Southwestern Idaho.",nt"license_title":
